import "./Contact.scss";

function Contact() {
  return (
    <div>
      <div className="floater"></div>
      <div className="intro">
        <h1>Get in touch</h1>
        <p>
          If you like my resume, think our interests align, or just want to
          chat, feel free to reach out!
        </p>
        <a href="mailto:m2fariha@uwaterloo.ca" target="_blank">
          Say Hello
        </a>
      </div>
    </div>
  );
}

export default Contact;
